  group('Text box field creation support', () {
    test('test 1', () {
      final PdfDocument document = PdfDocument();
      final PdfPage page = document.pages.add();
      final PdfTextBoxField firstNameTextBox = PdfTextBoxField(
          page, 'firstNameTextBox', const Rect.fromLTWH(100, 20, 200, 20),
          text: 'password',
          font: PdfStandardFont(PdfFontFamily.courier, 12),
          isPassword: true,
          multiline: true);
      firstNameTextBox.backColor = PdfColor(0, 255, 0);
      firstNameTextBox.borderColor = PdfColor(255, 0, 0);
      firstNameTextBox.foreColor = PdfColor(0, 0, 255);
      document.form.fields.add(firstNameTextBox);
      document.form.setDefaultAppearance(true);
      expect(firstNameTextBox.name, 'firstNameTextBox');
      expect(firstNameTextBox.font.name, 'courier');
      expect(firstNameTextBox.bounds.toString(),
          'Rect.fromLTRB(100.0, 20.0, 300.0, 40.0)');
      expect(firstNameTextBox.text, 'password');
      expect(firstNameTextBox.isPassword, true);
      expect(firstNameTextBox.multiline, true);
      final List<int> bytes = document.saveSync();
      savePdf(bytes, 'FLUT_947_test_1.pdf');
      document.dispose();
    });
